Setting expireAfterSeconds on index for ttl not working in documentDb 4.0<p>I am trying to make an exclusive lock semaphore using mongoose on a documentDb collection document.
The index and document gets created alright, however the document never expire. I've tried turning createdAt into a string and set it to an ISO string, to no avail. Any ideas how to get ttl to work in documentDb 4.0? I can delete the document when I am done, however I want to automatically clear this in case the executed script dies holding the lock.</p>
<pre><code>const mongoose = require('mongoose');
const {Schema} = require(&quot;mongoose&quot;);
const { v4: uuidv4 } = require('uuid');
const { exec } = require(&quot;child_process&quot;);

const whoAmI = uuidv4();

(async () =&gt; {

  await mongoose.connect(connectionString);

  const LockSchema = new Schema({
    id: String,
    owner: String,
    createdAt: { type: Date, required: true, default: Date.now },
  });

  LockSchema.index( { &quot;createdAt&quot;: 1 }, { expireAfterSeconds: 30 } )

  const Lock = mongoose.model(&quot;migration&quot;, LockSchema, &quot;locks&quot;);

  result = await Lock.findOneAndUpdate({id: &quot;lock&quot;}, { $setOnInsert: { owner: whoAmI}}, { upsert: true, new: true}).lean();
  if (result?.owner === whoAmI) {
    await exec(&quot;&lt;something&gt;&quot;, async (error, stdout, stderr) =&gt; {
      mongoose.disconnect();
      if (error) {
        console.log(`error: ${error.message}`);
        return;
      }
      if (stderr) {
        console.log(`stderr: ${stderr}`);
        return;
      }
      console.log(&quot;done...&quot;)
    });
  }
})();
</code></pre>

