C# - MongoDB ChangeStream Check if specify property changed<p>I need to watch for changes for a specific field in collection using C#.</p>
<p>So far I've being able to watch for any changes in document.</p>
<p>How can I check if a specific field was changed?</p>
<pre class="lang-cs prettyprint-override"><code>internal class CollectionWatcherService
{
    private readonly IMongoDatabase _mongoDatabase;
    private readonly ILogger&lt;CollectionWatcherService&gt; _logger;

    public CollectionWatcherService(IMongoDatabase mongoDatabase, ILogger&lt;CollectionWatcherService&gt; logger)
    {
        _mongoDatabase = mongoDatabase;
        _logger = logger;
    }

    public async Task&lt;bool&gt; Watch(string collectionName, CancellationToken cancellationToken = default)
    {
        try
        {
            var collection = _mongoDatabase.GetCollection&lt;BsonDocument&gt;(collectionName);
            var pipeline = CreatePipeline(collectionName);
            var options = CreateCursorOptions();
            using var cursor = await CreateWatcherCursor(collection, pipeline, options, cancellationToken);
            while (await ShouldContinueWatching(cursor, cancellationToken))
            {
                _logger.LogInformation(&quot;Waiting for changes: {time}&quot;, DateTimeOffset.Now);
                var batch = cursor.Current;
                foreach (var documentChange in batch)
                {
                    _logger.LogInformation(&quot;Changed&quot;);
                }
            };
            return true;
        }
        catch (Exception ex)
        {
            _logger.LogError(&quot;Error&quot;, ex);
            return false;
        }
    }

    private static async Task&lt;bool&gt; ShouldContinueWatching(IChangeStreamCursor&lt;ChangeStreamDocument&lt;BsonDocument&gt;&gt; cursor,CancellationToken cancellationToken)
    {
        return !cancellationToken.IsCancellationRequested &amp;&amp; await cursor.MoveNextAsync(cancellationToken);
    }

    private static ChangeStreamOptions CreateCursorOptions()
    {
        return new ChangeStreamOptions { FullDocument = ChangeStreamFullDocumentOption.UpdateLookup };
    }

    private static PipelineDefinition&lt;ChangeStreamDocument&lt;BsonDocument&gt;, ChangeStreamDocument&lt;BsonDocument&gt;&gt;
        CreatePipeline(string collectionName)
    {
        return new EmptyPipelineDefinition&lt;ChangeStreamDocument&lt;BsonDocument&gt;&gt;()
            .Match(Builders&lt;ChangeStreamDocument&lt;BsonDocument&gt;&gt;.Filter
                .And(
                    Builders&lt;ChangeStreamDocument&lt;BsonDocument&gt;&gt;.Filter.Eq((document =&gt; document.OperationType), ChangeStreamOperationType.Update),
                    Builders&lt;ChangeStreamDocument&lt;BsonDocument&gt;&gt;.Filter.Eq((document =&gt; document.CollectionNamespace.CollectionName), collectionName)
                )
        );
    }

    private static Task&lt;IChangeStreamCursor&lt;ChangeStreamDocument&lt;BsonDocument&gt;&gt;&gt; CreateWatcherCursor(IMongoCollection&lt;BsonDocument&gt; collection, PipelineDefinition&lt;ChangeStreamDocument&lt;BsonDocument&gt;, ChangeStreamDocument&lt;BsonDocument&gt;&gt; pipeline, ChangeStreamOptions options, CancellationToken cancellationToken)
    {
        return collection
            .WatchAsync(pipeline, options, cancellationToken);
    }
}

</code></pre>
<p>The field that I need to check for changes is <strong>status</strong></p>
<p>I've tried to add the following code to the and statement, but the code it's throwing an exception saying</p>
<blockquote>
<p>Expression not supported: document.UpdateDescription.UpdatedFields.</p>
</blockquote>
<pre class="lang-cs prettyprint-override"><code> Builders&lt;ChangeStreamDocument&lt;BsonDocument&gt;&gt;.Filter.AnyStringIn((document =&gt; document.UpdateDescription.UpdatedFields.Names), &quot;status&quot;)
</code></pre>

