    res.status(200).json({
      success: true,
      data: user
    });

  })
</code></pre>
<p>And i have the following middleware functions:</p>
<pre><code>const jwt = require('jsonwebtoken');
const asyncHandler = require('./async');
const ErrorResponse = require('../utils/errorResponse');
const User = require('../models/User');

// Protect Routes 
exports.protect = asyncHandler(async (req, res, next) =&gt; {
