          }, &quot;$ReceiverId&quot;, &quot;$RequesterId&quot;]
        }
      },
      pipeline: [{
        $match: {
          $expr: {
            $or: [{
              $eq: [ &quot;$$actorId&quot;, &quot;$ActorId&quot; ]
