          }
        }
      }, {
        $addFields: {
          RoomLikes: {
            $size: &quot;$Room.RoomActorLikes&quot;
          }
        }
      }, {
        $project: {
          _id: 0,
          ActorId: &quot;$ActorId&quot;,
          Name: &quot;$Name&quot;,
          Money: &quot;$Progression.Money&quot;,
          Fame: &quot;$Progression.Fame&quot;,
          Fortune: &quot;$Progression.Fortune&quot;,
          IsExtra: &quot;$Extra.IsExtra&quot;,
          RoomLikes: &quot;$RoomLikes&quot;
        }
      }],
      as: &quot;friends&quot;
    }
  },
  {
    $lookup: {
      from: &quot;users&quot;,
      pipeline: [{
        $match: {
          ActorId: 2
        }
      }, {
        $addFields: {
          RoomLikes: {
            $size: &quot;$Room.RoomActorLikes&quot;
          }
        }
      }, {
        $project: {
          _id: 0,
          ActorId: &quot;$ActorId&quot;,
          Name: &quot;$Name&quot;,
          Money: &quot;$Progression.Money&quot;,
          Fame: &quot;$Progression.Fame&quot;,
          Fortune: &quot;$Progression.Fortune&quot;,
          IsExtra: &quot;$Extra.IsExtra&quot;,
          RoomLikes: &quot;$RoomLikes&quot;
        }
      }],
      as: &quot;user&quot;
    }
  },
  {
    $project: {
      newArray: {
        $concatArrays: [ &quot;$user&quot;, &quot;$friends&quot; ]
      }
    }
  },
  {
    $unwind: &quot;$newArray&quot;
  },
  {
    $replaceRoot: {
      newRoot: &quot;$newArray&quot;,
    }
  },
  {
    $group: {
      _id: &quot;$ActorId&quot;,
      ActorId: { $first: &quot;$ActorId&quot; },
      Name: { $first: &quot;$Name&quot; },
      Money: {$first: &quot;$Money&quot;  },
      Fame: { $first: &quot;$Fame&quot; },
      Fortune: { $first: &quot;$Fortune&quot; },
      IsExtra: { $first: &quot;$IsExtra&quot; },
      RoomLikes: { $first: &quot;$RoomLikes&quot; }
    }
  },
  {
    $match: {
      ActorId: { $ne: 1 }, // Remove MSPRetro account from the result
      IsExtra: 0 // Remove deleted users from the result
    }
  },
  { $sort: { Fame: -1 } },
  { $skip: request.pageindex * 7 },
  { $limit: 7 }
]);
</code></pre>
<p>Thanks in advance for your help!</p>

